import React, { Component } from 'react'
import {Link ,BrowserRouter as Router} from 'react-router-dom';

export default class Nav extends Component {
  render() {
    return (
      <div>
        <ul>
        <li>Home</li>
        <Router>
            <Link to="/aboutus">
            About Us
            </Link>
            <Link to="/contactus">
            <li >Contact Us</li>
            </Link>
            </Router>    


            </ul>
      </div>
    )
  }
}
